import React, { useState } from "react";

const Index = (props) => {
  const [changePassword, setChangePassword] = useState("");

  const changePass = () => {
    var password = props.user.password;
    var passwordHide = "";

    for (let i = 0; i < password.length; i++) {
      passwordHide += "*";
    }

    return passwordHide;
  };

  return (
    <tr>
      <td>{props.index}</td>
      <td>{props.user.email}</td>
      <td>{changePass()}</td>
      <button className="btn btn-eye fas fa-eye" />
      <td>
        <span
          className={
            props.user.role
              ? "p-1 bg-warning rounded"
              : "p-1 bg-secondary rounded text-white"
          }
        >
          {props.user.role ? "Admin" : "Customer"}
        </span>
      </td>
      <td>
        <button className="btn shadow-none fas fa-edit"></button>
        <button className="btn shadow-none fas fa-trash"></button>
      </td>
    </tr>
  );
};

export default Index;
